function openPopup(selector){
  $('.popup'+selector).addClass('open');
}
function checkForm(form){
  var check = true;
  form.find('.required').each(function(){

    if($(this).filter(':checkbox').length){
      if(!$(this).prop('checked')){
        $(this).closest('label').addClass('error');
        check = false;
      }
      else{
        $(this).closest('label').removeClass('error');
      }
    }
    else if($(this).filter('.letters').length){
      if(/^[a-zA-Zа-яА-Я\s\-]+$/.test($(this).val())){
        $(this).closest('label').removeClass('error');
      }
      else{
        $(this).closest('label').addClass('error');
        check = false;
      }
    }
    else if($(this).filter('.nums').length){
      if(/^[0-9]+$/.test($(this).val())){
        $(this).closest('label').removeClass('error');
      }
      else{
        $(this).closest('label').addClass('error');
        check = false;
      }
    }
    else if($(this).val() == '') {
      $(this).closest('label').addClass('error');
      check = false;
    }
    else {
      $(this).closest('label').removeClass('error');
    }
  });
  return check;
}

